import sqlite3
import logging
from flask import Blueprint, request, jsonify
from database import connectDB
from database import fullpath
from database import closeDB
from auth import isAPIKeyValid
log = logging.getLogger(__name__)
elevate = Blueprint('elevate', __name__)
database = "elevate.db"


@elevate.route('/api/v1/elevate/config', methods=['GET'])
def getConfig():
    result = {
        'message': 'failure'
    }
    db = connectDB(fullpath(database))
    log.info("getConfig() Called.........")
    if isAPIKeyValid(request.headers.get('X-API-Key')):
        if db:
            try:
                cursor = db.cursor()
                query = "SELECT * from `config`;"
                cursor.execute(query)
                result['message'] = 'success'
                result['config'] = dict(cursor.fetchall())
                cursor.close()
            except sqlite3.Error as error:
                log.info('Error while connecting to SQLite: %s', error)
            finally:
                closeDB(db)
        else: 
            return jsonify(result), 500
    else:
        return jsonify(result), 401
    return jsonify(result)


@elevate.route('/api/v1/elevate/config/<string:type>', methods=['GET', 'POST'])
@elevate.route('/api/v1/elevate/config/<string:type>/<string:key>', methods=['GET', 'POST'])
def ConfigActions(type, key="0"):
    result = {
        'message': 'failure'
    }
    query = ""
    if isAPIKeyValid(request.headers.get('X-API-Key')):
        if type:
            if type == 'create' and request.method == 'POST':
                query = "CREATE TABLE IF NOT EXISTS `config` (`Key` VARCHAR (50) PRIMARY KEY NOT NULL, `Value` TEXT);"
            elif type == 'add' and request.method == 'POST':
                if(request.args.get('Key') != "" and request.args.get('Key') != None):
                    NewKey = request.args.get('Key')
                    NewValue = ""
                    if(request.args.get('Value') != "" and request.args.get('Value') != None):
                        NewValue = request.args.get('Value')
                    query = "INSERT INTO `config` (`Value`, `Key`) VALUES ('" + NewValue + "', '"+ NewKey +"');"
            elif type == 'view' and request.method == 'GET':
                if key:
                    query = "Select Value from `config` WHERE `Key` = '" + key + "';"
            elif type == 'update' and request.method == 'POST':
                if key:
                    NewKey = key
                    NewValue = ""
                    if(request.args.get('Key') != "" and request.args.get('Key') != None):
                        NewKey = request.args.get('Key')
                    if(request.args.get('Value') != "" and request.args.get('Value') != None):
                        NewValue = request.args.get('Value')
                    query = "UPDATE `config` SET `Key` = '"+ NewKey +"', Value = '" + NewValue + "' WHERE `Key` = '" + key + "';"
            elif type == 'delete' and request.method == 'POST':
                if key:
                    query = "DELETE FROM `config` WHERE `Key` = '" + key + "';"
            else:
                return jsonify(result), 404
        else:
            return jsonify(result), 404
        
        db = connectDB(fullpath(database))
        log.info("ConfigActions() Called.........")
        if db:
            try:
                cursor = db.cursor()
                cursor.execute(query)
                if type == 'create':
                    cursor.execute(getConfigInsertQuery())
                if type == 'view':
                    result['data'] = cursor.fetchall()
                result['message'] = 'success'
                cursor.close()
            except sqlite3.Error as error:
                log.info('Error while connecting to SQLite: %s', error)
            finally:
                closeDB(db)
        else: 
            return jsonify(result), 500
    else:
        return jsonify(result), 401
        
    return jsonify(result)


